import Button from "../button";

const Card = (instrument, auteur, titre, description) => {
    return (
        <div className="card-container">
            <div>{instrument}</div>
            <div>{auteur}</div>
            <h1></h1>
            <Button variant="no-border" title="Regarder masterclass"></Button>
            <div>{description}</div>

        </div>
    );
};

export default Card;
